import React from 'react';

import VIDEO_DATA from '../../homepage-data/video-data';

import CollectionPreview from '../collection-preview/collection-preview.component';

import {
  Player,
  ControlBar,
  ReplayControl,
  ForwardControl,
  CurrentTimeDisplay,
  TimeDivider,
  PlaybackRateMenuButton,
  VolumeMenuButton
} from 'video-react';

class Video extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      collections: VIDEO_DATA
    };
  }

  render() {
  return (
    <Player poster="/assets/poster.png">
      <source src="https://res.cloudinary.com/allansendagi-com/video/upload/v1565809385/videos/Pexels6_acxh9i.mp4" />
      <source src="https://res.cloudinary.com/allansendagi-com/video/upload/v1565809320/videos/Pexels3_vzolxz.mp4" />
      <ControlBar>
        <ReplayControl seconds={10} order={1.1} />
        <ForwardControl seconds={30} order={1.2} />
        <CurrentTimeDisplay order={4.1} />
        <TimeDivider order={4.2} />
        <PlaybackRateMenuButton rates={[5, 2, 1, 0.5, 0.1]} order={7.1} />
        <VolumeMenuButton disabled />
      </ControlBar>
    </Player>
    );
  }
};

export default Video;
